class Utils:
    def __init__(self):
        self.ext_txt = ".txt"
        self.ext_fa = ".fa"
        self.ext_dat = ".dat"
        self.ext_gtf = ".gtf"
        self.ext_xlsx = ".xlsx"

    def read_dat_file_by_line_to_list(self,path):
        tmp_list = []
        with open(path + self.ext_dat, "r") as f:
            gene_str = ""
            CDC_str = ""
            idx = 0
            while True:
                tmp_line = f.readline().replace("\n", "")

                if tmp_line != '':
                    if "gene=ENSCSAG00000016985.1" in tmp_line:
                        break

                    if " gene " in tmp_line:
                        idx = idx + 1
                        print(str(idx) + ":::::::::::::::::::::::::::::::::::")

                    # print(tmp_line)
                    tmp_list.append(tmp_line)
                else:
                    break
        return tmp_list

    """
    Chlorocebus_sabaeus.ChlSab1.1.99.chr.gtf
        this file doesn't have full gene name.
    """
    def read_gtf_file_by_line_to_dict(self, path, description_dict):
        tmp_dict = {}
        sm_gene_diff_trscrpt = []
        test_flag = 0
        with open(path + self.ext_gtf, "r") as f:
            idx = 0
            target_gene_name = ""
            while True:
                tmp_line = f.readline().replace("\n", "")

                if tmp_line != '':
                    if "#!" in tmp_line:
                        continue

                    line_arr = tmp_line.split("\t")

                    title = line_arr[2]
                    details_arr = line_arr[8].split(";")
                    chr_fname = line_arr[0]

                    if chr_fname == "MT":
                        continue
                    # TODO delete when it's done
                    elif chr_fname == "20":
                        break

                    if title == "gene":
                        target_gene_name = details_arr[2].split(" ")[2].replace('"','')
                        test_flag = 0
                    elif title == "transcript":
                        idx = idx + 1
                        tmp_dict[idx] = {}
                        tmp_dict[idx].update({"chr_fname": chr_fname})
                        tmp_dict[idx].update({"Target gene name": target_gene_name})
                        if chr_fname in description_dict:
                            if target_gene_name in description_dict[chr_fname]:
                                tmp_dict[idx].update({"Description": description_dict[chr_fname][target_gene_name]})
                        ensembl_trscrpt_id = details_arr[2].split(" ")[2].replace('"', '') + "." + \
                                             details_arr[3].split(" ")[2].replace('"', '')
                        tmp_dict[idx].update({"Ensembl transcript ID": ensembl_trscrpt_id})
                        gene_id = details_arr[0].split(" ")[1].replace('"', '') + "." + details_arr[1].split(" ")[2].replace('"', '')
                        tmp_dict[idx].update({"Ensembl Gene ID": gene_id})
                        tmp_dict[idx].update({"Strand": line_arr[6]})

                        test_flag = test_flag + 1
                        if test_flag > 1:
                            sm_gene_diff_trscrpt.append("chr [" + chr_fname + "] target_gene_nm : " + target_gene_name + ", trscrpt_id : " + ensembl_trscrpt_id + ", gene_id : " + gene_id)

                    elif title == "CDS":
                        if "CDS" in tmp_dict[idx]:
                            tmp_dict[idx]["CDS"].append(line_arr[3] + " " + line_arr[4] + " " + details_arr[4].split(" ")[2].replace('"',''))
                        else:
                            tmp_cds_seq_list = [line_arr[3] + " " + line_arr[4] + " " + details_arr[4].split(" ")[2].replace('"', '')]
                            tmp_dict[idx].update({"CDS": tmp_cds_seq_list})
                    # key "CDS" and its array as value are existed already, and replace start_seq to start_codon's start_seq
                    elif title == "start_codon":
                        tmp_cds_first_arr = tmp_dict[idx]["CDS"][0].split(" ")
                        # TODO need to check old_CDS' exon num and start_codon's exon num?
                        tmp_dict[idx]["CDS"][0] = line_arr[3] + " " + tmp_cds_first_arr[1] + " " + tmp_cds_first_arr[2]
                    elif title == "stop_codon":
                        tmp_cds_last_arr = tmp_dict[idx]["CDS"][-1].split(" ")
                        # TODO need to check old_CDS' exon num and start_codon's exon num?
                        tmp_dict[idx]["CDS"][-1] = tmp_cds_last_arr[0] + " " + line_arr[4] + " " + tmp_cds_last_arr[2]

                else:
                    break

        return tmp_dict, sm_gene_diff_trscrpt

